INSERT INTO `parameter` (`PARAMETERID`, `NAME`, `DEFINITION`, `PARAMETER2PARAMETERTYPE`, `DEFAULTVALUE`, `DESCRIPTION`) VALUES (1,'BrowseNodeId','BrowseNodeId',1,NULL,NULL),(2,'ResponseGroup','ResponseGroup',1,'BrowseNodeInfo',NULL),(3,'Ancestors','MostGifted',2,NULL,NULL),(4,'BrowseNode','NewReleases',2,NULL,NULL),(5,'Children','MostWishedFor',2,NULL,NULL),(6,'Name','TopSellers',2,NULL,NULL),(7,'Actor','Actor',1,NULL,'Actor name associated with the item. You can enter all\nor part of the name.'),(8,'Artist','Artist',1,NULL,'Artist name associated with the item. You can enter all\nor part of the name.'),(9,'AudienceRating','AudienceRating',1,NULL,'Movie ratings based on MPAA ratings or age, depending\non locale. You can specify one or more values in a\ncomma-separated list in a REST request or with multiple\nelements in a SOAP request.'),(10,'Author','Author',1,NULL,'Author name associated with the item. You can enter all\nor part of the name.'),(11,'Availability','Availability',1,NULL,'Returns available items only. This parameter must\nbe used with the Condition parameter. When\nAvailability is set to Available, the Condition\nparameter cannot be set to New.'),(12,'Brand','Brand',1,NULL,'Brand name associated with the item. You can enter all\nor part of the name.'),(13,'BrowseNode','BrowseNode',1,NULL,'Browse nodes are numbers that identify product\ncategories. For example, the browse node for Literature\n& Fiction is 17, while the browse node for Outdoors &\nNature is 290060.'),(14,'Composer','Composer',1,NULL,'Composer name associated with the item. You can\nenter all or part of the name.'),(15,'Condition','Condition',1,NULL,'The Condition parameter filters offers by condition\ntype. By default, Condition equals New. When the\nAvailability parameter is set to Available, the\nCondition parameter cannot be set to New.\nWhen Condition is set to All, ItemSearch returns\none offer per condition.\nCondition can be used with every index, except All\nand Blended.'),(16,'Conductor','Conductor',1,NULL,'Conductor name associated with the item. You can\nenter all or part of the name.'),(17,'Director','Director',1,NULL,'Director name associated with the item. You can enter\nall or part of the name.'),(18,'IncludeReviewsSummary','IncludeReviewsSummary',1,NULL,'Returns the reviews summary URL.'),(19,'ItemPage','ItemPage',1,NULL,'Returns a specific page of items from the available\nsearch results. Up to ten items are returned per page.\nIf you do not include ItemPage in your request, the first\npage is returned.'),(20,'Keywords','Keywords',1,NULL,'A word or phrase that describes an item, including\nauthor, artist, description, manufacturer, title, and so on.'),(21,'Manufacturer','Manufacturer',1,NULL,'Manufacturer name associated with the item. You can\nenter all or part of the name.'),(22,'MaximumPrice','MaximumPrice',1,NULL,'Specifies the maximum item price in the response.\nPrices appear in the lowest currency denomination. For\nexample, 3241 is $32.41.'),(23,'MerchantId','MerchantId',1,NULL,'Filters search results and offer listings to items sold by\nAmazon. By default, the Product Advertising API returns\nitems sold by merchants and Amazon.'),(24,'MinimumPrice','MinimumPrice',1,NULL,'Specifies the minimum item price in the response.\nPrices appear in the lowest currency denomination. For\nexample, 3241 is $32.41.'),(25,'MinPercentageOff','MinPercentageOff',1,NULL,'Specifies the minimum percentage off the item price.'),(26,'Orchestra','Orchestra',1,NULL,'Orchestra name associated with the item. You can enter\nall or part of the name.'),(27,'Power','Power',1,NULL,'Performs a book search with a complex query string.\nThe parameter can be used only when SearchIndex is\nset to Books.'),(28,'Publisher','Publisher',1,NULL,'Publisher name associated with the item. You can enter\nall or part of the name.'),(29,'RelatedItemPage','RelatedItemPage',1,NULL,'Returns a specific page of related items from the\navailable search results. Up to ten items are returned\nper page. This parameter can be used with the\nRelatedItems response group.'),(30,'RelationshipType','RelationshipType',1,NULL,'Returns the relationship between associated items.\nExample values include Episode, Season, and Tracks.'),(31,'SearchIndex','SearchIndex',1,NULL,'The product category to search. Some ItemSearch\nparameters are valid only with specific values of\nSearchIndex.'),(32,'Sort','Sort',1,NULL,'The way in which items in the response are ordered.'),(33,'Title','Title',1,NULL,'Title associated with the item. You can enter all or part\nof the title. Title searches are a subset of Keyword\nsearches. Use a Keywords search if a Title search\ndoes not return the items you want.\nTitle can be used with every index, except All and\nBlended.'),(34,'TruncateReviewsAt','TruncateReviewsAt',1,NULL,'By default, reviews are truncated to 1000 characters.\nChoose a value to specify a length. To return the entire\nreview, use 0 .'),(35,'VariationPage','VariationPage',1,NULL,'Returns a specific page of variations. For example, set\nVariationPage to 2 to return offers 11 to 20 . The total\nnumber of pages appears in the TotalPages element.'),(36,'ResponseGroup','ResponseGroup',1,NULL,'Specifies the types of values to return. Separate multiple\nresponse groups with commas.'),(37,'Accessories','Accessories',2,NULL,NULL),(38,'AlternateVersions','AlternateVersions',2,NULL,NULL),(39,'BrowseNodes','BrowseNodes',2,NULL,NULL),(40,'EditorialReview','EditorialReview',2,NULL,NULL),(41,'Images','Images',2,NULL,NULL),(42,'ItemAttributes','ItemAttributes',2,NULL,NULL),(43,'ItemIds','ItemIds',2,NULL,NULL),(44,'Large','Large',2,NULL,NULL),(45,'Medium','Medium',2,NULL,NULL),(46,'OfferFull','OfferFull',2,NULL,NULL),(47,'OfferListings','OfferListings',2,NULL,NULL),(48,'Offers','Offers',2,NULL,NULL),(49,'OfferSummary','OfferSummary',2,NULL,NULL),(50,'PromotionSummary','PromotionSummary',2,NULL,NULL),(51,'RelatedItems','RelatedItems',2,NULL,NULL),(52,'Reviews','Reviews',2,NULL,NULL),(53,'SalesRank','SalesRank',2,NULL,NULL),(54,'SearchBins','SearchBins',2,NULL,NULL),(55,'Similarities','Similarities',2,NULL,NULL),(56,'Small','Small',2,NULL,NULL),(57,'Tracks','Tracks',2,NULL,NULL),(58,'Variations','Variations',2,NULL,NULL),(59,'VariationOffers','VariationOffers',2,NULL,NULL),(60,'VariationMatrix','VariationMatrix',2,NULL,NULL),(61,'VariationSummary','VariationSummary',2,NULL,NULL),(200,'ChannelId','ChannelId',1,NULL,NULL),(201,'VideoId','VideoId',1,NULL,NULL),(202,'SearchText','SearchText',1,NULL,NULL),(203,'Title','Title',2,NULL,NULL),(204,'Url','Url',2,NULL,NULL);
